// import photo3 from "../stockPhotos/coffee L logo.jpg";

const Design = () => {
  return (
    <div className='D-Component'>
      <div className='D-Page'>
        <h1 className='Page-Title'>Design</h1>
        <img className='D-Image' src={photo1} alt='' />
      </div>
    </div>
  );
};

export { Design };
